-- ===========================================
-- Import Rakko Keyword data for ジョブメドレー
-- ===========================================

-- First, ensure the media exists
DO $$
DECLARE
  v_media_id UUID;
BEGIN
  SELECT id INTO v_media_id FROM media_master WHERE domain = 'job-medley.com' LIMIT 1;
  IF v_media_id IS NULL THEN
    RAISE EXCEPTION 'Media with domain job-medley.com not found';
  END IF;
END $$;

-- Insert keywords

-- Verify import
SELECT COUNT(*) as imported_count FROM keywords WHERE media_id = (SELECT id FROM media_master WHERE domain = 'job-medley.com' LIMIT 1);